import Navbar from './Navbar';
import Race from './Race';
import React, { useEffect, useState } from "react";
import '../App.css';
import MyProfile from './MyProfile';

function Home() {
  return (
    <div className="Page">
    <div className="App">
      <div className="main">
          <MyProfile/>
      </div>
    </div>
    </div>
  );
}

export default Home;
